import React, { useEffect, useState } from "react";

function App() {
  const [Users, setUsers] = useState([]);

  useEffect(() => {
    const getUsers = async () => {
      var usersName = "anny";
    };
    getUsers();
  }, []);
  return (
    <div>
      <button type="file">browse</button>
      {Users}
    </div>
  );
}

export default App;
